CREATE TABLE worker(
	worker_id TEXT,
	memo TEXT,
	completion_code TEXT,
	total_reward REAL,
	PRIMARY KEY(worker_id)
);

CREATE TABLE session(
	session_id INTEGER,
	session_start_time TEXT,
	session_end_time TEXT,
	PRIMARY KEY(session_id)
);

CREATE TABLE window(
	window_id INTEGER,
    worker_id INTEGER,
	window_start_time TEXT,
	window_end_time TEXT,
	window_score REAL,
	PRIMARY KEY(window_id, worker_id)
);

CREATE TABLE task_type(
	task_type_id INTEGER,
	title TEXT,
	template TEXT,
	description TEXT,
	reward REAL,
	requester TEXT,
	keywords TEXT,
	PRIMARY KEY(task_type_id)
);

CREATE TABLE task(
	task_id INTEGER,
	task_type_id INTEGER,
	question TEXT,
	answer TEXT,
	PRIMARY KEY(task_id), 
	FOREIGN KEY(task_type_id) REFERENCES task_type(task_type_id)
);

CREATE TABLE task_instance(
	task_instance_id TEXT,
	task_id INTEGER,
	worker_id TEXT,
	answer TEXT,
	answer_time TEXT,
	window_id INTEGER,
	quality_score REAL,
	PRIMARY KEY(task_instance_id),
	FOREIGN KEY(task_id) REFERENCES task(task_id),
	FOREIGN KEY(worker_id) REFERENCES worker(worker_id),
	FOREIGN KEY(window_id) REFERENCES window(window_id)
);

CREATE TABLE worker_session(
	worker_session_id INTEGER,
	worker_id TEXT,
	session_id INTEGER,
	PRIMARY KEY(worker_session_id),
	FOREIGN KEY(worker_id) REFERENCES worker(worker_id),
	FOREIGN KEY(session_id) REFERENCES session(session_id)
);

CREATE TABLE session_window(
	session_window_id INTEGER,
	session_id INTEGER,
	window_id INTEGER,
	PRIMARY KEY(session_window_id),
	FOREIGN KEY(session_id) REFERENCES session(session_id),
	FOREIGN KEY(window_id) REFERENCES window(window_id)
);

